CREATE PROCEDURE AddBooking
    @BoardinghouseId INT,
    @ClientId NVARCHAR(450),
    @CheckInDate DATETIME,
    @CheckOutDate DATETIME,
    @TotalAmount DECIMAL(18, 2),
    @Status NVARCHAR(50) = 'Pending'
AS

BEGIN SET NOCOUNT ON;
UPDATE Bookings SET ApprovalStatus = @ApprovalStatus WHERE BookingId = @BookingId;
IF @ApprovalStatus = 'Approved' BEGIN UPDATE BoardingHouses SET IsAvailble = 0 WHERE BoardinghouseId = @BoardinghouseId; END
IF @ApprovalStatus = 'Rejected' BEGIN DELETE FROM Bookings WHERE BookingId = @BookingId; END END;

CREATE PROCEDURE ApproveOrRejectBooking
    @BookingId INT,
    @ApprovalStatus NVARCHAR(50), 
    @BoardinghouseId INT
AS

BEGIN
    SET NOCOUNT ON;

    DELETE FROM BoardingHouseImages
    WHERE BoardinghouseId = @BoardinghouseId;
END;

BEGIN
    SET NOCOUNT ON;

    DELETE FROM Amenities
    WHERE AmenityId = @AmenityId;
END;

BEGIN
    SET NOCOUNT ON;

    DELETE FROM BoardingHouses
    WHERE BoardinghouseId = @BoardinghouseId;
END;

BEGIN
    SET NOCOUNT ON;

    DELETE FROM BoardingHouseImages
    WHERE ImageId = @ImageId;
END;

BEGIN
    SET NOCOUNT ON;

    SELECT * 
    FROM BoardingHouses;
END;

BEGIN
    SET NOCOUNT ON;

    SELECT * 
    FROM Amenities
    WHERE BoardinghouseId = @BoardinghouseId;
END;

BEGIN
    SET NOCOUNT ON;

    SELECT 
        a.Name AS AmenityName,
        a.Price AS AmenityPrice
    FROM BookingAmenities ba
    INNER JOIN Amenities a ON a.AmenityId = ba.AmenityId
    WHERE ba.BookingId = @BookingId;
END;

BEGIN
    SET NOCOUNT ON;

    SELECT ImageId, ImageBase64, Description
    FROM BoardingHouseImages
    WHERE BoardinghouseId = @BoardinghouseId;
END;

BEGIN
    SET NOCOUNT ON;

    SELECT * 
    FROM BoardingHouses
    WHERE TenantId = @TenantId;
END;

BEGIN
    SET NOCOUNT ON;

    SELECT * 
    FROM Bookings
    WHERE ApprovalStatus = 'Pending';
END;

BEGIN
    SET NOCOUNT ON;

    UPDATE Bookings
    SET ClientId = NULL, ApprovalStatus = 'Cancelled'  
    WHERE BoardinghouseId = @BoardinghouseId AND ClientId = @ClientId AND ApprovalStatus = 'Pending';

    UPDATE BoardingHouses
    SET IsAvailble = 0
    WHERE BoardinghouseId = @BoardinghouseId;

    DELETE FROM ClientRequests
    WHERE BoardinghouseId = @BoardinghouseId AND ClientId = @ClientId;

    SELECT 'Client removed and boarding house marked as unavailable, ClientRequest deleted.' AS Message;
END;

